    htmlScore(raw) 
    {
        let RegExp = /<(?=.*? .*?\/ ?>|a|span|div|p|br|hr|input|!--|wbr)[a-z]+.*?>|<([a-z]+).*?<\/\1>/gmi;
        
        //Contains html or is html?
        let rawArr = raw.split("\n");
        let htmlCtr = 0;
        let startsWithHtml = false;
        let endsWithHtml = false;
        for(let i=0; i <= rawArr.length; i++)
        {
            //Starts and ends with specific html tags
            if(i===0 && /(<(|html|body|div|p|a|span)*>)/gmi.test(rawArr[i]))
            {
                startsWithHtml = true;
            }
            if(i===rawArr.length-1 && /(<\/*(|html|body|div|p|a|span)>)/gmi.test(rawArr[i]))
            {
                endsWithHtml = true;
            }

            //Line has html
            if(RegExp.test(rawArr[i]))
            {
                htmlCtr++; 
            }
        }

        let score = htmlCtr / rawArr.length * 100;

        if(startsWithHtml && endsWithHtml)
        {
            //Starts and ends with HTML - Way more likely to be html
            score = score + (score * 2.5);
        }
        if((startsWithHtml && !endsWithHtml) || (!startsWithHtml && endsWithHtml))
        {
            //Mixed content for sure
            score = score - (score * .2);
        }

        //console.log('html ' + score + '%');

        //let RegExpScore = RegExp.test(raw); //Original
        
        return score;
    }

